import '../components.css'
import Header from "../components/header";

const PostJob = () => {

    return(
        <>
        <Header />





        <div className="login-container">
        <h1 style={{ marginBottom: '20px' }}>Create a New Job Post Here</h1>
        </div>
        <form action="" method="POST">
          <input type="text" name="job_title" placeholder="job title"></input> <br />
          <input type="text" name="short_job_description" placeholder="short job description"></input><br />
          <input type="text" name="full_job_description" placeholder="full job description"></input><br />

          <button className="register-button">Submit</button>
        </form>

        </>

    );
}

export default PostJob;
